messages.content:
现在请仅输出严格 JSON，必须完全匹配以下结构（键名、层级、字段齐全），所有数值用数字表示（保留2-3位小数），布尔用 true/false，字符串填写说明文字。不要输出任何解释文字或前后缀，也不要多余字段；若无法计算某值请给出可解析的近似值。

{
  "call": "[字符串]",
  "inputs": {
    "two_theta": "[字符串]",
    "intensity": "[字符串]",
    "prominence": "[数值]"
  },
  "output": {
    "result": {
      "peak_positions": "[10个数值的数组]",
      "peak_intensities": "[10个数值的数组]",
      "peak_count": "[数值]"
    },
    "metadata": {
      "prominence_used": "[数值]",
      "angular_range": "[2个数值的数组]",
      "total_data_points": "[数值]"
    }
  }
}
